full_text:
I hope your testimony today will help to galvanize us to act now before we truly are out of time. #ClimateCrisis  

@GretaThunberg

@Jamie_Margolin

@vict_barrett

@BenjiBacker

As a former District Attorney, the more I digest of the Mueller Report, the harder it is to swallow: 

❌That a document with redactions on one third of its pages is transparent;

❌That there wasn’t evidence of obstruction of justice.

As a former District Attorney, the more I digest of the Mueller Report, the harder it is to swallow: 

❌That we have an AG who represents the public as opposed to one individual;

❌That the Russian attack on our democracy and the subsequent investigation were hoaxes;

